import React from "react";
import "./App.css";
import Login from "./compon/Login";
import Posts from "./compon/Posts";
import { BrowserRouter, Route,  Routes,} from "react-router-dom";
import { render } from "react-dom";

function App() {
  return (
 
      <BrowserRouter>

       <Routes>
        <Route path="/login"> 
        <Login/>
         </Route>
        <Route path="/posts"> 
          <Posts />
        </Route>
        </Routes>
      </BrowserRouter>

  );
}
export default App;
